import React from 'react'


const Table2 = ({ data }) => {
  return (
    <div style={{ display: 'flex', flexWrap: 'wrap' }}>
      {data.map((item) => (
        <div key={item.id} style={{ flexBasis: '20%', padding: 10 }}>
          <img src={item.imageSrc} alt={`${item.first_name}`} style={{ width: '100%', height: 'auto' }} />
          <div>{item.email}</div>
        </div>
      ))}
    </div>
  );
};
  
  export default Table2;
